import{_ as e,b as n,o as i,Q as t}from"./chunks/framework.CUk_15SL.js";const o="data:image/png;base64,",s="data:image/png;base64,",l="data:image/png;base64,",T=JSON.parse('{"title":"格式化配置文件 editorConfig 属性说明","description":"Vscode 格式化配置文件 editorConfig 属性说明","frontmatter":{"id":21,"date":"2023/12/04 10:26","title":"格式化配置文件 editorConfig 属性说明","tag":"Vscode使用","description":"Vscode 格式化配置文件 editorConfig 属性说明"},"headers":[],"relativePath":"VscodeEditorConfig.md","filePath":"VscodeEditorConfig.md"}'),c={name:"VscodeEditorConfig.md"};function r(p,a,d,h,f,u){return i(),n("div",null,a[0]||(a[0]=[t('<h1 id="格式化配置文件-editorconfig-属性说明" tabindex="-1">格式化配置文件 editorConfig 属性说明 <a class="header-anchor" href="#格式化配置文件-editorconfig-属性说明" aria-label="Permalink to &quot;格式化配置文件 editorConfig 属性说明&quot;">​</a></h1><h2 id="editorconfig-文件" tabindex="-1">editorConfig 文件 <a class="header-anchor" href="#editorconfig-文件" aria-label="Permalink to &quot;editorConfig 文件&quot;">​</a></h2><p>文件名为<code>.editorConfig</code>。其中属性为键值对形式<code>key = value</code>，结尾不用分号，注释使用井号<code>#</code>。当文件使用 editorConfig 格式化时会以当前文件同级开始由下向上查找，直到根目录或者配置 root 为 true 为止，多个配置文件为属性追加不覆盖形式合并。例如第一个文件配置 a=1、第二个文件配置 a=2，b=3，合并后为 a=1，b=3，这只是做解释而不是真实的配置。</p><h2 id="vscode-中使用" tabindex="-1">Vscode 中使用 <a class="header-anchor" href="#vscode-中使用" aria-label="Permalink to &quot;Vscode 中使用&quot;">​</a></h2><p>Vscode 可以安装<code>EditorConfig for VS Code</code>插件，也可以安装其他组件。 <img src="'+o+'" alt="Alt text"></p><p>这里使用<code>Prettier - Code formatter</code>插件为例。 <img src="'+s+'" alt="Alt text"></p><p>其中配置<code>Use Editor Config</code>即可启动 editorConfig 文件中的格式化配置 <img src="'+l+`" alt="Alt text"></p><h2 id="属性配置" tabindex="-1">属性配置 <a class="header-anchor" href="#属性配置" aria-label="Permalink to &quot;属性配置&quot;">​</a></h2><h3 id="" tabindex="-1">[*] <a class="header-anchor" href="#" aria-label="Permalink to &quot;[*]&quot;">​</a></h3><p>使用中括号时表明匹配的文件，[*]表示匹配全部文件，[*.js]表示匹配全部 js 文件</p><h3 id="root-true" tabindex="-1">root = true <a class="header-anchor" href="#root-true" aria-label="Permalink to &quot;root = true&quot;">​</a></h3><p>告诉 EditorConfig 插件，这是根文件，不用继续往上查找</p><h3 id="charset-utf-8" tabindex="-1">charset = utf-8 <a class="header-anchor" href="#charset-utf-8" aria-label="Permalink to &quot;charset = utf-8&quot;">​</a></h3><p>设置字符集为 utf-8</p><h3 id="indent-style-space" tabindex="-1">indent_style = space <a class="header-anchor" href="#indent-style-space" aria-label="Permalink to &quot;indent_style = space&quot;">​</a></h3><p>缩进风格，space 为空格缩进、tab 为制表符缩进</p><h3 id="indent-size-2" tabindex="-1">indent_size = 2 <a class="header-anchor" href="#indent-size-2" aria-label="Permalink to &quot;indent_size = 2&quot;">​</a></h3><p>缩进的空格数</p><h3 id="end-of-line-lf" tabindex="-1">end_of_line = lf <a class="header-anchor" href="#end-of-line-lf" aria-label="Permalink to &quot;end_of_line = lf&quot;">​</a></h3><p>结尾换行符，可选 lf、cr、crlf</p><h3 id="insert-final-newline-true" tabindex="-1">insert_final_newline = true <a class="header-anchor" href="#insert-final-newline-true" aria-label="Permalink to &quot;insert_final_newline = true&quot;">​</a></h3><p>在文件结尾插入新行</p><h3 id="max-line-length-120" tabindex="-1">max_line_length = 120 <a class="header-anchor" href="#max-line-length-120" aria-label="Permalink to &quot;max_line_length = 120&quot;">​</a></h3><p>换内最大列数，超过时换行</p><h3 id="trim-trailing-whitespace-true" tabindex="-1">trim_trailing_whitespace = true <a class="header-anchor" href="#trim-trailing-whitespace-true" aria-label="Permalink to &quot;trim_trailing_whitespace = true&quot;">​</a></h3><p>删除一行中的前后空格</p><h2 id="配置示例" tabindex="-1">配置示例 <a class="header-anchor" href="#配置示例" aria-label="Permalink to &quot;配置示例&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>[*]</span></span>
<span class="line"><span>root = true</span></span>
<span class="line"><span>charset = utf-8</span></span>
<span class="line"><span>indent_style = space</span></span>
<span class="line"><span>indent_size = 2</span></span>
<span class="line"><span>end_of_line = lf</span></span>
<span class="line"><span>insert_final_newline = true</span></span>
<span class="line"><span>trim_trailing_whitespace = true</span></span>
<span class="line"><span>max_line_length = 120</span></span></code></pre></div>`,28)]))}const O=e(c,[["render",r]]);export{T as __pageData,O as default};
